import Head from 'next/head'
import {useEffect} from 'react'
import Router, {useRouter} from 'next/router'

function Projects() {

  let projectRoutes = ['music-app', 'reservation-app', 'electric-bill', 'music-player3', 'music-player4', 'music-player5']

  const router = useRouter()
  let params;
  projectRoutes.forEach( r => {
    if(router.query.projects === r) {
      params = r
    }
  })

  console.log(params)

  if(params === 'apple'){
    Router.replace('/404')
  }

  // useEffect(() => {
  // })

  return (
     <div className="container">
        <Head>
          <title>Aiman Adlawan | Projects</title>
          <link rel="icon" href="/images/brand-icon-logo.ico" />
        </Head>

        <div className="container">
          {/* <TopLayover/> */}
          <div className="main-container">
            asdfadsf
            {/* <PageDataContext pagesets={'contacts'}>
              <Navbar />       
              <Menu />
              <main className='main'>
                <Header/>
                <Message />
                <Footer />
              </main>
            </PageDataContext> */}
          </div>
        </div>
      </div>
  )
}

export default Projects
